import React from "react";
import "./Description.css";

export default function Description() {
  return (
    <div className="Description">
      <h3>Description</h3>
      <p>
        [Migr-ai-tion.net]Â is
        <br /> an applied, interdisciplinary
        <br /> research project that investigates
        <br /> the potentials of AI as a participatory
        <br /> and therapeutic medium to work with the
        <br /> digital diaspora. Situated at the nexus of
        <br /> migration studies, media anthropology and
        <br /> speculative design, the project tackles
        <br /> issues such as data colonialism,
        <br /> stereotypes, marginalisation,
        <br /> collective trauma and
        <br /> agency.
      </p>
    </div>
  );
}
